import './App.css';

import logo from './logo.svg';

function App() {
  return (
    <div className='App'>
      <header className='App-header'>
        <img src={logo} className='App-logo' alt='logo' />
        <p>
          Not Edit <code>src/App.js</code> and save to reload. It\'s cool, I like it
        </p>
        <a
  className = 'App-link'
  href = 'https://reactjs.org'
  target = '_blank'
  rel = 'noopener noreferrer' > Learn React</a>
      </header>
      </div>
  );
}

export default App;
